import Head from 'next/head';
import Menu from '../components/Menu';
import { Jumbotron, Container } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {
    return (
        <>
            <Head>
                <title>Home</title>
                <meta name='description' content='React with Next class' />
                <meta name='author' content='Marcos dos Santos Carvalho' />
            </Head>
            <Menu />
            <Jumbotron fluid className="services">
                <style>
                    {`
                        .services {
                            padding-top:80px;
                            padding-bottom:80px;
                            background-color:#000;
                            color:#fff
                        }
                    `}
                </style>
                <Container className='text-center'>
                    <h1 className='display-4'>Serviços</h1>
                    <p className='lead'>Soluções que sua empresa precisa</p>
                </Container>
            </Jumbotron>
            <Jumbotron fluid className="services-2">
                <style>
                    {`
                        .services {
                            padding-top:80px;
                            padding-bottom:80px;
                            background-color:#0f0;
                            color:#fff
                        }
                    `}
                </style>
                <Container className='text-center'>
                    <h1 className='display-4'>Serviços</h1>
                    <p className='lead'>Soluções que sua empresa precisa</p>
                </Container>
            </Jumbotron>
            <h1>Home page</h1>
        </>
    );
}

export default HomePage;
